import clsx from 'clsx';
import { Link } from 'react-router-dom';
import styles from './ButtonShow.module.scss'
import { useSelector } from 'react-redux';
import { getAllTables } from '../../redux/store';


const ButtonShow = (props) => {
  const tables = useSelector(state => getAllTables(state));

  return (
    <div>
      {tables.map(table => (
        <Link to={'/tables/' + table.id}><button className={clsx("btn-default, btn-lg", styles.btnshow)}>Show more</button></Link>
      ))}
    </div>

  )
}

export default ButtonShow;
